Material:Cordura fabric with waterproof lining<br>Accommodates:Sony NEX-FS100U Super 35 mm camcorder<br>Weight:1lbs / 0.45kg<br><br><br>・Made of durable Cordura fabric with a waterproof lining<br>・Gives you full access to all camera controls<br>・Lens cover allows for different lens types  follow focus mechanisms<br><br><br>The Porta Brace Rain Slicker for Sony NEX-FS100U Camcorder is a protective cover that shields your valuable Sony NEX-FS100U Super 35mm camcorder from the rain. Made of durable Cordura fabric with a waterproof lining  the slicker gives you full access to all camera controls and features newly designed lens covers that allows for different lenses and follow focus mechanisms.</DIV>
