External dimensions:36.5'' x 12'' x 3.5'' / 92.71 x 30.48 x 8.89cm<br>Size:36'' x 12'' x 2.5'' / 91.44 x 30.48 x 6.35cm<br><br><br>・Optimal transportation and storage for rifles with or without mounted optics<br>・Padded to keep rifles secure and protected<br>・Constructed of 1000-denier heavy-duty nylon<br>・Military-grade #10 YKK zippers with durable pulls and self-healing system<br>・Adjustable interior straps for precise rifle placement<br>・Exterior padded compartment with PALS webbing<br>・Lockable zippers<br>・Adjustable shoulder strap with comfort padding<br>・Durable handles made of military grade nylon webbing<br>・Heavy-duty metal loops enable use as a drag bag<br><br><br>These lightweight but incredibly strong shotgun and rifle cases are constructed of a 1000-denier  water-resistant ballistic nylon fabric. Our tactical long-gun cases are designed to rake a beating as they safeguard your shotgun or tactical rifle from the elements.<br><br></DIV>
