Compatibility:2 Bass Guitars<br>Handles:Padded Nylon Handle & Backpack Straps<br>Latches:Zipper<br>Dimensions:Interior: <br>Body (L x H): 21.00 x 3.50'' / 53.34 x 8.89cm<br>Lower Bout Width: 15.00'' / 38.1cm<br>Middle Bout Width: 12.00'' / 30.48cm<br>Upper Bout Width: 13.00'' / 33.02cm<br>Overall Length: 47.00'' / 119.38cm<br>Weight:11.0 lbs / 4.99kg<br><br><br>・Ultra- thick padded sidewalls<br>・Micro-fleece interior<br>・Protective rain cover<br>・Multi adjustable straps<br>・Body Block Internal Shock Absorber<br>・Tablet pocket<br>・Internal cable management<br>・Sheet music pocket<br><br><br>The Gator Cases ProGo Series Ultimate Gig Bag is made up of durable nylon shell features strategically placed plastic feet and paneled corners to hold up over years of use. The case also features a hidden protective rain cover to protect your instrument in all kinds of weather. The Gator Cases ProGo Series Ultimate Gig Bag for 2 Bass Guitars comes standard with both side and front handles so you can get a grip from any angle. Transport is made easy with the multi-adjustable removable backpack straps allowing you to get from gig to gig in comfort. <br><br>On the interior  your guitar or bass will be cradled with a lush micro-fleece. The ultra-thick padded sidewalls give the ProGo a sturdy feel and prevent damage during incidental drops. The Body Block internal shock absorber gives this gig bad serious protection in a light weight package. <br><br>Knowing that the modern musician carries more than just their instrument to gigs  the Gator Cases ProGo Series Ultimate Gig Bag for 2 Bass Guitars comes equipped with plenty of storage for your accessories  including an internal cable management compartment  a tablet pocket and a sheet music pocket for storing everything from compositions to set lists. <br><br>It has been ''toughness'' tested to insure your guitar or bass can get through all of the rigors of touring. It's good to know that your instrument will be protected from some pretty severe punishment while nestled in a Gator ProGo Ultimate Gig Bag.<br><br></DIV>
