Material:Ballistic Nylon<br>Maximum Screen Size Supported:15.6''<br>Carrying Options:Shoulder Strap<br>Handle<br>Trolley Strap<br>Compatibility:Notebook<br>Accessories<br>Key<br>File Folder<br>Cellular Phone<br>Business Card<br>Pen<br>Accessibility:Top Loading<br>Interior Dimensions:14.75x2.00x11.50'' (37.46x5.08x29.21cm)<br>External Dimensions:15.50x5.75x13.25'' (39.37x14.60x33.65cm)<br>Weight:2.51lbs (1.13kg)<br><br><br>・Top-load entry design for enhanced ease of use<br>・Overlapping leather wrapped handles conform to the hand for maximum comfort<br>・Padded shoulder strap contours the shoulder to distribute weight evenly and reduce strain  adjustable and removable<br>・Quick-access outer pocket for cell phone or small items<br>・Front compartment business organizer with key fob and pockets for pens  business cards  mobile accessories and other essentials<br>・Inner compartment features an expandable file section and accessory pockets<br>・Great laptop compartment heavily padded for protection<br>・Integrated trolley strap for wheeled case piggyback<br><br><br>The Codi Riserva Ballistic Nylon Case features a triple compartment design that's perfect for just the essentials. A padded computer compartment is enhanced with a rear pocket for files and peripherals. A business essentials organizer completes the case  with room for pens  business cards and accessories.</DIV>
