・A LensCoat for all seasons and habitats<br>・Available in Forest Green Woodland Cameo  Realtree Hardwoods Snow & Advantage Max4 HD<br>・Available in - Canon ''White'' and Black<br>・Sports shooters and photojournalist can get the benefits too<br><br><br>LensCoat Lens Covers... <br><br>Moving a big white (or black) lens near skittish wildlife is like waving your arms a sure way to flush your subject and ruin what could be a once-in-a-lifetime photo opportunity. LensCoat Lens Covers mask your 200 mm to 600 mm lens  giving you a better chance at getting the shot. <br><br> LensCoat Lens Covers are manufactured from 100% closed-cell neoprene  offering protection from bumps  jars and nicks  with a camouflage-pattern fabric cover. LensCoat Lens Covers also provide a thermal barrier  protecting your hands from cold lenses in lower temperatures. They are easy to install and remove  leaving no residue on the lens. And LensCoat lens covers are waterproof  providing protection in harsh conditions. <br><br> Other features include a clear  flexible UV-PVC window over the AF/IS/VR controls and the distance-scale window. The LensCoat also features custom holes that reveal the red-dot for easy alignment to the camera body without removing the cover. <br><br> LensCoat for the Nikon 500 f/4 VR <br> LensCoatTM 500 telephoto lens cover offers your valuable equipment some protection from scrapes and bumps  preserving its resale value. It also helps break up the shape of your lens  making it less noticeable to wildlife. <br><br> The LensCoatTM N500VR features a clear plastic windows over the auto focus controls and also the distance scale.</DIV>
