Compatible with:iPhone 5<br>Dimensions:Interior: 4.9x2.7x0.55'' / 12.44x6.85x1.39cm<br><br><br>・Compatible with iPhone 5 series and many other smart phones of similar size<br>・Floats with provided floating lanyard<br>・Waterproof to 99' (IPX8 Rating)<br>・Sand proof<br>・Shock resistant<br>・Fully functional touch screen<br>・Communicate with phone in the case<br>・Video above and under water (Touch screen functionality could be hampered under water depending on water pressure)<br>・Protection from snow  rain  dust and sand<br>・Comes with yellow adjustable neck lanyard and yellow floating lanyard<br><br><br>The Aryca Wave 3 is a waterproof smart phone case (yellow) that allows for full functionality of your phone. With simple twist and lock access this easy to use product provides all the protection you need for your smart phone. Wave 3 protects against water  sand and dirt. Its hard outer shell also provides shock absorption. With a transparent silicone membrane you maintain full functionality of your phone.</DIV>
