Lid Depth:4-1/8''<br>Base Depth:4''<br>Material:Polyethylene<br>Process:Thermoformed<br>Ratings:ATA 300<br>Outside Dimensions:38.4'' x 13.7'' x 9.5'' / 97.54 x 34.80 x 24.13 cm<br>Inside Dimensions:36.75'' x 12'' x 8.25'' / 93.35 x 30.48 x 20.96 cm<br>Weight:12.2 lbs / 5.53 kg<br><br><br>・Heavy-duty built-in wheels<br>・Durable spring-loaded end handles<br>・Prominent bumpers protect gasketed aluminum valence at every critical impact point<br>・Protective web straps for easy carrying<br>・TSA-approved locks<br>・ATA rated<br><br><br>Well adept at holding valuable equipment securely in place  this heavy-duty  military specified low-profile shipping case has built-in wheels and a spacious interior. With spring loaded reverse-cinchbuckles on it's base and lid  the 1SKB-H3611W is an excellent option for shipping drum trap stands. <br><br>SKB Rail-Pack Utility Cases  like all SKB hardshell cases are built to last. These tough as nails cases are designed for real abuse. The LP Series Shipping Cases are the containers of choice for transporting goods around the corner or around the world with maximum protection.</DIV>
