Capacity:One DSLR with standard zoom lens attached  one extra lens  accessories(memory cards  battery and charger) or MILC body with telephoto lens attached ( like SONY 55-210mm)  standard & pancake lens  accessories (memory cards  battery and charger)<br>Interior Fabric:150D Polyester + Velvet<br>Exterior Fabric:1200D x 1200D Polyester<br>Inside Dimensions (L x W x H):180 x 105 x 160mm / 7.08 x 4.13 x 6.29''<br>Outside Dimensions (L x W x H):260 x 140 x 200mm / 10.23 x 5.51 x 7.87''<br>Weight:320 g / 11.28 oz<br><br><br>・Quick shoulder strap adjustment system<br>・Multiple accessory pockets to keep gear organized<br>・Anti-shock feet on bottom<br><br><br>The Vanguard Pampas II 18 Camera Shoulder Bag (Purple) is a stylish protector for your DSLR or compact  mirrorless interchangeable lens camera setup. Light in weight but big on protection  Pampas II 18 won't ever slow you down or wear you out. Its shoulder strap features a Quick Adjustment System  making sure it instantly fits with comfort.</DIV>
