Material:Exterior: 1000 denier Cordura nylon<br>Interior: Plastic reinforced sides <br>Interior: Padded foam<br>Type of Closure:Touch fastener<br>Carrying/Transport Options:Shoulder strap<br>Internal Dimensions (L x W x H):270 x 140 x 150 mm<br>10.6 x 5.5 x 6 inch<br>External Dimensions (L x W x H):500 x 240 x 170 mm <br>19.7 x 9.5 x 6.7 inch<br>Weight:1.3 Kg/ 2.9 lb<br><br><br>・Large detachable outside pocket for headphones and cables<br>・Two fixed pockets for HF units and microphones<br><br><br>The CamRade audioMate I is a 1000 denier Cordura nylon bag designed to carry and protect many audio mixers or recorders. It has a padded foam interior with reinforced plastic sided. The bag has a detachable front pocket and 2 fixed pockets for microphones  cables and batteries. Main compartment holds the audio mixer and interior dividers. <br><br>There are ports between the compartments to pass the cables through. It has clear vinyl covers with a touch fastener on top of the bag that protects the equipment  while allowing view of the controls. The bag is carried by a removable  adjustable shoulder strap or an optional audio harness. There are rings on top for the shoulder strap or harness and rings on the bottom to fix the harness-belt.</DIV>
