Materials:Polyester<br>Compatibility:Most DSLR Cameras<br>Two Additional Lens<br>One Additional Lens Plus a Flash<br>Accessories<br>Fits Devices:7.1x4.6x13.2'' / 18.03x11.68x33.52 cm<br>Dimensions:8.1x7.9x15'' / 20.57x20.06x38.1 cm<br>Weight:1.27lbs (0.58kg)<br><br><br>・Compatible with most DSLR cameras  two additional lens or one additional lens plus a flash and accessories<br>・Adjustable  padded dividers allow you to customize the camera compartment<br>・Front zippered pocket and top compartment provide organization and easy access to non-camera accessories<br>・Dedicated internal memory card slip pocket<br>・Weather hood fits snugly over the bag to protect from the elements (when not in use  store in dedicated back panel compartment)<br>・Side straps adjust to secure a tripod or monopod<br>・Adjustable sternum strap provides security and comfort<br>・Innovative strap management system eliminates messy  hanging straps<br>・Padded  mesh back panel provides comfort and breathability<br><br><br>With an overall casual aesthetic and optimal space for camera gear and daily personal items  Case Logic CPL-107/GRAY DSLR Camera Sling provides the on-the-go photographer with an all-in-one option. The side camera compartment provides easy  fumble-free camera access. Contemporary quilting reveals just how much padding is protecting your camera.</DIV>
